import React from "react";
import { Switch, Route, Link, Router } from "react-router-dom";
import "./App.css";
import Signin from "./pages/auth/login";

function App() {
  return (
    <Router>
      <Switch>
        <Route path="/about">
          <About />
        </Route>
        <Route path="/users">
          <Users />
        </Route>
        <Route path="/">
          <Home />
        </Route>
      </Switch>
    </Router>
  );
}

export default App;
